lc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"1261201","type":"CustomJS"},{"attributes":{"coordinates":null,"formatter":{"id":"1260820"},"group":null,"major_label_policy":{"id":"1261100"},"ticker":{"id":"1260791"},"visible":false},"id":"1260790","type":"LinearAxis"},{"attributes":{"source":{"id":"1261062"}},"id":"1261075","type":"CDSView"},{"attributes":{},"id":"1261114","type":"LinearScale"},{"attributes":{},"id":"1260831","type":"BasicTicker"},{"attributes":{"bottom":{"field":"Close"},"fill_alpha":{"value":0.1},"fill_color":{"field":"inc","transform":{"id":"1261069"}},"hatch_alpha":{"value":0.1},"line_alpha":{"value":0.1},"line_color":{"value":null},"top":{"field":"Open"},"width":{"field":"_width"},"x":{"field":"index"}},"id":"1261072","type":"VBar"},{"attributes":{},"id":"1260843","type":"ResetTool"},{"attributes":{"fill_color":"#ffffea","line_color":"#ffcb66","x":{"field":"index"},"y":{"field":"equity_dd"}},"id":"1260856","type":"Patch"},{"attributes":{"line_alpha":0.1,"line_color":"#ff7f0e","line_width":1.3,"x":{"field":"index"},"y":{"field":"adx(H,L,C)_0_2"}},"id":"1261163","type":"Line"},{"attributes":{"dimensions":"width"},"id":"1260984","type":"PanTool"},{"attributes":{"dimensions":"width","maintain_focus":false},"id":"1260799","type":"WheelZoomTool"},{"attributes":{"source":{"id":"1260814"}},"id":"1261081","type":"CDSView"},{"attributes":{},"id":"1260938","type":"Selection"},{"attributes":{"coordinates":null,"data_source":{"id":"1260854"},"glyph":{"id":"1260856"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"1260858"},"nonselection_glyph":{"id":"1260857"},"view":{"id":"1260860"}},"id":"1260859","type":"GlyphRenderer"},{"attributes":{"coordinates":null,"data_source":{"id":"1260814"},"glyph":{"id":"1261053"},"group":null,"hover_glyph":null
